import React from 'react'
export default function TwoWayBinding(){
    const[name,setName]=useState("")
    const changeName=(event)=>setName(event.target.value)

    return(
        <div>
            <p>Two Way Binding</p>
            <input onChange={changeName}value={name}></input>
            <p>The name is {name}</p>
        </div>
    )
}
